import styled from 'styled-components';
export const StyledIntro = styled.div`
position: relative;
height: 88.5rem;
background : black;
.line{
   color:red; 
   width: 100%;
   diplay:flex;
   white-space: nowrap;
   position: absolute;
  top: 30%;
  left: 50%;
  transform: translate(-50%, -50%);
  -ms-transform: translate(-50%, -50%);
}


`;
